import { style } from "typestyle";
import TestBgImage from '../../../assets/images/testBg.png'

 const QuizPageStyle = style({
     position: 'relative',
     marginTop: '90px',
     height: '100vh',
     $nest: {
         '& .QuizRegister': {
             backgroundColor: '#FF5E5C',
             height: '100%',
            $nest: {
                '& h3': {
                    zIndex: 2,
                    position: 'absolute',
                    textAlign: 'center',
                    fontFamily: 'GothamBold',
                    fontSize: '39px',
                    top: 30,
                    left: 60
                },
                '& .circle': {
                    position: 'relative',
                    height: '150px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    width: '150px',
                    borderRadius: '50%',
                    // backgroundColor: 'red',
                    border: 'solid black 3px',
                    $nest: { 
                        '& .circle_color': {
                            height: '105%',
                            width: '105%',
                            borderRadius: '50%',
                            position: 'absolute',
                            left: -10,
                            top: -10,
                            backgroundColor: '#33DFCA',
                            zIndex: -1
                        },
                        '& .num': {
                            zIndex: 1,
                            fontFamily: 'GothamBold',
                            fontSize: '36px'
                        }
                    }
                },
                '& .wave': {
                   position: 'absolute',
                   top: 0
                },
                '& .logo': {
                   position: 'absolute',
                   top: 0
                },
            }
         },
     }
 })

 export default QuizPageStyle
